package abi

import (
	"context"
	"encoding/hex"
	"reflect"
	"testing"

	"github.com/tonkeeper/tongo"
	"github.com/tonkeeper/tongo/boc"
	"github.com/tonkeeper/tongo/tvm"
)

const (
	mainnetConfig = ""
)

func Test_contractInspector_InspectContract(t *testing.T) {

	mainnetConfig, _ := boc.DeserializeBocBase64(mainnetConfig)

	tests := []struct {
		name    string
		code    string
		account string
		data    string
		want    map[ContractInterface][]string
	}{
		{
			account: "606DA8365EA43302A567FA7B84C604442BD6855D14156B6B58685A604CE0FB1C",
			code:    "",
			data:    "B5EE9C7201010201003C0001590000000163DB941BA317BE6D05A095B841DFC5AD719E71E49027E63A970787F78F2B781992B68ABA73BDC400C0010013A031EDCCBB735BC7FAC0",
			want: map[ContractInterface][]string{
				StorageProvider: {"get_public_key"},
				Wallet:          {},
			},
		},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			codeBytes, _ := hex.DecodeString(tt.code)
			dataBytes, _ := hex.DecodeString(tt.data)
			codeCell, _ := boc.DeserializeBoc(codeBytes)
			dataCell, _ := boc.DeserializeBoc(dataBytes)
			address, err := hex.DecodeString(tt.account)
			if err != nil {
				t.Fatalf("DecodeString() failed: %v", err)
			}
			var addr [32]byte
			copy(addr[:], address[:])
			account := tongo.AccountID{Address: addr, Workchain: 0}
			ci := NewContractInspector()
			emulator, err := tvm.NewEmulator(codeCell[0], dataCell[0], mainnetConfig[0], tvm.WithLazyC7Optimization())
			contractDescription, err := ci.InspectContract(context.Background(), codeBytes, emulator, account)
			if err != nil {
				t.Fatalf("InspectContract() failed: %v", err)
			}
			got := map[ContractInterface][]string{}
			for ifaceName, iface := range contractDescription.Interfaces {
				got[ifaceName] = []string{}
				for method := range iface.GetMethods {
					got[ifaceName] = append(got[ifaceName], method)
				}
			}
			if !reflect.DeepEqual(got, tt.want) {
				t.Errorf("InspectContract() got = %v, want %v", got, tt.want)
			}
		})
	}
}

func Test_getCodeInfo(t *testing.T) {
	tests := []struct {
		name        string
		code        string
		wantHash    string
		wantMethods map[int64]struct{}
	}{
		{
			code:     "",
			wantHash: "feb5ff6820e2ff0d9483e7e0d62c817d846789fb4ae580c878866d959dabd5c0",
			wantMethods: map[int64]struct{}{
				0: {}, 76407: {}, 78748: {}, 81467: {}, 85143: {}, 107653: {}, 524287: {},
			},
		},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			code, err := hex.DecodeString(tt.code)
			if err != nil {
				t.Fatalf("hex.DecodeString() failed: %v", err)
			}
			got, err := getCodeInfo(code)
			if err != nil {
				t.Fatalf("getCodeInfo() failed: %v", err)
			}
			if got.hash.Hex() != tt.wantHash {
				t.Fatalf("getCodeInfo() got = %v, want %v", got.hash.Hex(), tt.wantHash)
			}
			if !reflect.DeepEqual(got.methods, tt.wantMethods) {
				t.Errorf("getCodeInfo() got = %v, want %v", got.methods, tt.wantMethods)
			}
		})
	}
}
